Under the Birch and Swinnerton-Dyer conjecture, these primes consist of:
(i) p = 2;
(ii) p == 4, 7, or 8 (mod 9);
(iii) p == 1 (mod 9) and p divides A206309(p-1), i.e., Villegas-Zagier polynomial A166243((p-1)/3) evaluated at x=0.

